measurements.description:
Three flowers well presented on one 25-cm staked inflorescence;
 dorsal sepal cupuliform, rose-pink, spotted darker rose pink veins,
 darker rose-pink abaxial surface, spur 2.0 cm rose-pink;
 lateral sepals ovate, cupped, bright rose-pink;
 petals erect, cymbiform, oblong, yellow, maculated burgundy adabxial surface, rose-pink adaxial surface;
 lip narrowly lanceolate, recurved apically, rose-pink;
 column light rose-pink, anthers white;
 substance firm; texture satin.
